(1, 'About Us', NULL, 'about_us', '<h4 class=\"ql-align-justify\"><strong style=\"color: rgb(33, 37, 41);\">IOTtech Group&nbsp;</strong>is a multi-dimensional firm that is majorly engaged in the business of Research and Development in the fields of Automation (Industrial as well as Domestic), Internet of Things, Software Technology, and Edu Tech&nbsp;<span style=\"color: rgb(66, 66, 66);\">.</span></h4><h4><strong>IOTtech Group envision delivering best in class technology solutions.</strong></h4><h4 class=\"ql-align-justify\"><strong style=\"color: rgb(33, 37, 41);\">IOTtech bazaar&nbsp;</strong>is owned by&nbsp;IOTtech Smart Products Pvt. Ltd&nbsp;.<span style=\"color: rgb(33, 37, 41);\">&nbsp;</span>All the payments done on the IOTtech Bazaar website are credited by IOTtech Smart Products Pvt. Ltd.&nbsp;&nbsp;IOTtech Smart Products Pvt.Ltd.is one of the spearhead units of IOTtech Group that majorly engages in the development of all kinds of smart products that are being implemented in various fields ranging from Industrial Automation, Home automation, Health care systems, Agricultural Sector, and more. We did the research for years to come to this point, where we are offering various smart solutions in almost all sectors with perfection in the latest technology.</h4>', NULL, 'true', 'Admin', NULL, '2024-09-03 08:29:53', '2024-11-15 06:41:31'),
(2, 'Privacy & Policy', NULL, 'privary_policy', '<p>IOTtech Bazaar recognizes the importance of protecting personal details and information and provides this Privacy Policy with respect to the access and use of https://iottechbazaar.com/ and IOTtech Bazaar mobile Application (“Sites”) as owned and operated by us and/or our affiliates and payment facilitation services including bill payment services provided by us (“Services”). The term Sites will also include all pages that are sub-domains or are associated or within each Site and all devices, applications, features, technologies, functionalities and other services that IOTtech Bazaar operates or offers through such Sites.</p><p>For this Privacy Policy, the user of services may be educational establishments/ merchants/sellers/billers, customers/buyers/consumers, or any other persons using Services or accessing Sites (“User”, “you” or “your”). This Privacy Policy will help you understand our policies and procedures regarding the collection, handling and use of any information, which directly or in combination with other information, is capable of identifying the User (“Personal Information”).</p><p>By using our Services through the Sites, you signify your assent to this Privacy Policy and consent to the processing of your Personal Information. If you do not agree with this Privacy Policy do not, in any manner, use our Services or download, install and/or use the mobile application and website.</p><p>Information Collection</p><p>Profiling Information: We collect such information about you which is essential to operate our business and to enable us to deliver and improve our Services. We may obtain the following information about you, your clients and the device from which you avail of Services</p><p>Service Usage and Transactional Information: We only store transaction details such as the amount spent, merchant name, transaction ID, date and time of transaction.</p><p>Navigational and Log Information: We collect information about your navigation using our Services, for example, the URLs of websites from which you reach our Site, and from which you request downloads, pages visited/ downloaded on our Site, websites or pages of merchants you visit using our Services. We may also collect information such as your domain name, web request, IP address, mobile application version, type of operating system that your computer uses, browser type, browser language, location, date and time of the request, the products you buy, the referring site, and the time that you spend on the site.</p><p>Correspondence Information: We collect the content, information about your correspondence, and the destination/origin of communications between you and any other person using our Services, which include email communications, blog, chat room and discussion board communications, instant message communications, experts forum communications, facsimile mail communications, membership of mailing lists etc.</p><p>Cookies: A cookie is an insignificant portion of data that is sent to the web browser of your device from which the Site is accessed. If your web browser settings permit, cookies can be sent to your web browser for recording information about your online preferences and allowing us to cater to your interests in a better manner. You can set your browser to notify you when you are sent a cookie, giving you the chance to decide whether or not to accept it. If you do accept a cookie, you hereby agree to our use of information collected by us using that cookie.</p><p>Stored Information: We may collect any data or information either created by you or by a third party and which you wish to store on our servers such as user names, image files, documents, etc. or which may be required to display information to you through our Service.</p><p>Purpose &amp; Use of Information</p><p>We understand the importance of your Personal Information and ensure that it is used for the intended purpose. By accepting the terms of use you agree that we may collect and store your Personal Information, by the applicable law, as long as you subscribe to or use our Services subject to the limitations set out in this Privacy Policy.</p><p>We require the profiling information which includes details such as identity details, contact details, user names and passwords to manage our relationship with you and provide Services to you.</p><p>We collect and store your service usage and transactional information in order to enable you to view certain details of all your transactions which have been made using our Services, to provide you uninterrupted and satisfactory Services, to administer our relationship with you, to comply with any statutory or regulatory requirement, to monitor your use of our Services to ensure compliance with our user rules.</p><p>To improve our Services, we need to constantly update and alter our business and marketing strategies for which we require the navigational and log information to determine and analyse the merchants, markets, technology, operating systems, browsers, devices, and locations from which our Services are used most or used least. For example, such information and its analysis will help us focus more on your needs by providing you with a wider range of Services or developing updates for particular operating systems and mobile application versions, etc. Further, the information collected helps us offer you other products, programs, or services that we believe may be of interest to you. In addition, such information collected will help us alert you in case of software compatibility issues.</p><p>We want to serve you better and therefore we require your correspondence information to enable us to learn about the information and content of communications by you so that we can deduce your feedback from such communications, analyse, endeavour to improve, ask you for further feedback, and reply.</p><p>The data collected by cookies helps us track, analyse and understand User trends to enable us to understand lacunas (such as slow response time on our website page) and improve your interactive experience of using our Services, our web design, features and functionalities.</p><p>We access data or information stored by third parties in case required for providing you uninterrupted and satisfactory Services or in case consented by you.</p><p>For enabling you to make quicker transactions and relieving you from the hassle of copying/ keying in the 6 digit OTP, we use advanced technologies of a payment gateway provider company which would automatically retrieve the OTP and mention the same in the relevant column of the transaction page.</p><p>Combinations of the information collected as mentioned in this Privacy Policy such as physical address, device information, and email address when coupled with information which is not Personal Information such as speed of typing, the maximum screen area usage, other patterns and data help us detect and protect Users and ourselves against errors, fraud, or other criminal activity.</p><p>We collect and use some of your information in an aggregated form to compile statistical and demographical profiles for our business and marketing activities and to customise our Services to you. We may disclose such information about you, provided that the information is in an aggregated form that cannot be used or interpreted in such a manner as to identify you. It is clarified that the consolidated Personal Information of all Users which has been collected by us during the period services provided, may be used in whole or in part, in our sole discretion and without any compensation to you, for any legitimate purpose and you hereby confirm that you have no objection to the aforesaid use of your Personal Information.</p><p>Disclosure of Information</p><p>We do not disclose or share your Personal Information with any third party until essential for providing you Services; or for the below purposes by this Privacy Policy.</p><p>Information security is critical to us and we will not share your Personal Information with any other third parties except, and only to the extent necessary, with parties such as our merchants, acquiring banks, credit card processors, etc. for us to deliver payment processing services to you.</p><p>We do not disclose or distribute any of your Personal Information to a third party or use such Personal Information for commercial or marketing purposes unless we receive the express consent of the User. However, IOTtech Bazaar may, itself or through third parties, send you e-mails, SMS, such other means to communicate, send reminders for payment, advertise its services, promote new products and activities or for your invaluable feedback.</p><p>You acknowledge and agree that in the interests of improving personalisation and Service efficiency, we may, under controlled and secure circumstances, share your Personal Information with our affiliates or associates. If required, IOTtech Bazaar will:</p><p>Disclose it in a non-aggregated form which is not capable of being used or interpreted in such a manner as to identify you; or share it to deliver the Services desired by you; to maintain, further develop and enhance Services; to ensure the functionality and security of our Services; and to prevent and investigate any fraud and other misuse.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;If, by the usage of some functionalities of our Service, you receive Personal Information about other user(s), you agree to keep the same confidential and only use it in connection with the Services, without disclosing the same to another user or third party.</p><p>In order to ensure that all our users comply with the user rules, we may monitor your Personal Information to the extent that this may be required to determine compliance and/or to identify instances of non-compliance.</p><p>We may disclose the Personal Information pursuant to applicable laws, a directive or order of a government entity or statutory authority or any judicial or regulatory authority or to law enforcement agencies in any official investigation including but not limited to cyber incidents, prosecution and punishment of offences. You agree that IOTtech Bazaar has the right to monitor and to disclose Personal Information as may be necessary to satisfy any law, regulation or other governmental request. We may transfer Your Personal Information or other information collected, stored, or processed by&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;IOTtech Bazaar to any other entity or organization located in India or outside India only in case it is necessary for providing Services to You in connection with the Application. We will cooperate with the appropriate law enforcement authorities in investigating claims of illegal activity.</p><p>We will only disclose your Personal Information in accordance with this Privacy Policy. If we want to use it for any other purpose, we will obtain your prior written consent.</p><p>If you decline to submit Personal Information to us, then we will unfortunately not be in a position to provide the Services to you.</p><p>If all or some of the business, stock or assets of IOTtech Bazaar are acquired or merged with another business entity, we will share all or some of your information with this entity to continue to provide the Service to you. You will receive notice of such an event and the new entity will inform you of any changes to the practices in this Privacy Policy. If the new entity wishes to make additional use of your information, you may decline such use at such time.</p><p>&nbsp;&nbsp;&nbsp;IOTtech Bazaar does not control the acts of its Users. All Users should be aware that, when they disclose Personal Information such as their name, e-mail address, etc. to third parties, the Personal Information may be collected and used by others to send unsolicited e-mails from other parties, who may or may not be Users. In the event that you encounter any person is improperly collecting or using information about Users, please contact us by emailing at marketing@iottechsmart.com .</p><p>Security of Personal Information</p><p>&nbsp;&nbsp;&nbsp;We work to protect the security of your Personal information during transmission by using appropriate software, which encrypts the information you input. This encrypted information is stored on secure systems/computers. Further, we ensure that the number of employees involved in the management of the data center who have physical access to these computers is limited. Also, we use advanced security technology to prevent our computers from being accessed by unauthorized persons.</p><p>We have also implemented information security practices and standards and have in place comprehensively documented information security programmes and policies containing managerial, technical, operational and physical security measures that are in compliance with the Indian laws including, so as to protect the Personal Information provided to us from unauthorized access, use, modification, damage, disclosure or impairment. Further, we may from time to time use reasonable additional or alternative procedures to ensure the security and confidentiality of your Personal Information through our Sites.</p><p>&nbsp;&nbsp;&nbsp;No data transmission over the Internet is fully secure, so we cannot ensure or warrant the security of any information you submit to us. Further, we do not guarantee in any way, the security of any Personal Information that you transmit or share on the Site; and you do so at your own risk.</p><p>If any security breach comes to our knowledge, then we may take all steps required to protect misuse of such Personal Information and may attempt to notify you electronically so that you can take appropriate protective steps. Any of the information which you provide when you use our Services to an open public environment or forum including (without limitation) any blog, chat room, community, classifieds or discussion board, will not be considered confidential, will not be considered as Personal Information, and is not subject to protection under this Privacy Policy.</p><p>If, by usage of some functionalities of our Service, you receive Personal Information about other user(s), you agree to keep the same confidential and only use it in connection with the Services, without disclosing the same to another user or third party.</p><p>Since such public environments are accessible by third parties, it is possible that third parties may collect or use such information for their own purposes. You should accordingly be careful when deciding to share any of your Personal Information in such public environments. Please note that we are not liable to you or any third party for any damages that you or any third party may suffer on account of your disclosure of Personal Information in any public environment.</p><p>Security of Personal Information</p><p>&nbsp;&nbsp;&nbsp;IOTtech Bazaar reserves the right to change, modify, add, or remove portions of this Privacy Policy at any time for any reason. In case, any changes are made in the Privacy Policy, IOTtech Bazaar shall update the same on the website. Users should periodically review this page for the latest information on our privacy practices. Once posted, those changes are effective immediately, unless stated otherwise. Continued access or use of the Services constitutes your acceptance of the changes and the amended Privacy Policy. However, if you do not agree with the changes, please do not continue to use the Services or submit Personal Information to us.</p><p>Changes to the Information</p><p>&nbsp;&nbsp;&nbsp;If you are a User, and would like to view the information we have collected from you or you want to correct your information or details, please send us your request by email on the ‘contact us’ page on https://iottechbazaar.com/.</p><p>The User can at any time while availing the services or otherwise, withdraw his/her consent given previously to IOTtech Bazaar for collecting, receiving, possessing, storing, dealing or handling Personal Information of the User, by sending us your request by email on the ‘contact us’ page on https://iottechbazaar.com/. In such case, IOTtech Bazaar will unfortunately not be in a position to provide the Services to you. However, IOTtech Bazaar will be able to retain such Personal Information for the time period in accordance with the applicable laws.</p>', NULL, 'true', 'Admin', NULL, '2024-09-03 11:48:00', '2024-09-03 11:48:00'),
