(1, '1', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6ImFudXJhZ0BnbWFpbC5jb20iLCJpYXQiOjE3MjIyMzk5ODh9.OfV6yUjzeRywJfoqcKX9CC_V_xlB7zfE-W2NfV8MX3Y', '1', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJuYW1lIjoiQmFzaWMgU2luZ2xlIFBoYXNlIFNtYXJ0IFN1Ym1lcnNpYmxlIENvbnRyb2xsZXIiLCJpYXQiOjE3MjIyNTUxNDJ9.0O8hQnWjQyIz5qg2kbMJAKtImz4G7l7EtnAzq-CfuUk', '3', '<p>Very nice kit ,it helped me alot to complete my many projects, Also i learned about rc combination using this kit. Its completely unique thing for making multiple projects.</p>', 'true', '2024-08-23 16:02:20', '2024-08-26 15:49:19'),
(2, '1', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6ImFudXJhZ0BnbWFpbC5jb20iLCJpYXQiOjE3MjIyMzk5ODh9.OfV6yUjzeRywJfoqcKX9CC_V_xlB7zfE-W2NfV8MX3Y', '6', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJuYW1lIjoiWWFudHJhbSBULXNoaXJ0IHwgQ290dG9uIiwiaWF0IjoxNzIyMjU3MDAwfQ.qebYph-NqLoA4vICTYMPHNkYiccgeEKchvLZB-SstkE', '5', 'यह बाजार में उपलब्ध सर्वोत्तम इलेक्ट्रॉनिक किट है जिसमें एक में कई प्रोजेक्ट हैं। टीम द्वारा दिया गया मार्गदर्शन और ऑनलाइन समर्थन सराहनीय है।', 'true', '2024-08-25 15:15:43', '2024-08-25 15:15:43'),
(3, '1', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6ImFudXJhZ0BnbWFpbC5jb20iLCJpYXQiOjE3MjIyMzk5ODh9.OfV6yUjzeRywJfoqcKX9CC_V_xlB7zfE-W2NfV8MX3Y', '2', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJuYW1lIjoiQXF1YSBUb3VjaCB8IFNpbmdsZSBUYW5rIiwiaWF0IjoxNzIyMjU1NTUwfQ.G_hblFFlZ43Q_3OooC0srU-1LSY9kG_PDod4L1PALqE', '2', 'Very different type of kit . I enjoyed learning some unique projects and got second position in my science exhibition . It\'s such a great product', 'true', '2024-08-25 15:16:15', '2024-08-25 15:16:15'),
