(3, 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJuYW1lIjoiRW1iZWRkZWQgRWxlY3Ryb25pY3MgRXhwZXJpbWVudCBLaXQgKEJhc2ljIERJWSBraXQpIiwiaWF0IjoxNzIyMjU2Mzc5fQ.P8owbUHDTrCCHi8l636kqC6yei5c2goZUlNazD1VoFs', 'Embedded Electronics Experiment Kit (Basic DIY kit)', NULL, '30+ Projects, Access to Recorded Videos, Kit Manual', NULL, '8542', 'IB0046', 'Basic starter kit', '', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJuYW1lIjoiRWR1Y2F0aW9uYWwgS2l0cyBmb3IgU2Nob29sIiwiaWF0IjoxNzIxOTY0Njg4fQ.1iFTWGvMhF-R5BxUMOYoxAkkdZFMpzqcFNZ0zUfCCfc', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJuYW1lIjoiS2l0cyIsImlhdCI6MTcyMTk3ODc3MX0.l4bf54vh6aGi7cOOihGrZsqt3C1mjbr0zwXwO2MdGH0', '', '', '5000', '3600', 'Include', '18', 'Percentage', '28', '3051', '500', 'Embedded-Electronics-Experiment-Kit-Basic-DIY-kit', 'avatar-1722256379094.png', NULL, 'https://www.flipkart.com/yantaram-stemkit-1-educational-electronic-hobby-kit/p/itm9739cc92f7629?pid=EHKGHCXFZBW57BFT', 'https://www.amazon.in/dp/B0BQWJN9X9?ref=myi_title_dp', '', '<p><strong>Embedded Electronics Experiment Kit (Basic DIY Kit) with Free Course and Certification - Illuminate, Learn, and Achieve!</strong></p><p><br></p><p>The acronym STEM (Science, Technology, Engineering, and Mathematics) is used to refer to a broad range of these academic fields. This phrase frequently refers to curriculum options or educational policies in schools. It has ramifications for immigration policy, workforce development, and national security issues because a lack of STEM-educated people may make this sector less effective.</p><p><strong style=\"color: rgb(230, 0, 0);\"><em>IOTtech Education</em></strong> introduces this STEM Training Starter kit for the students of classes k-5 to k-8 to begin their journey to the upcoming smarter and innovative future world.</p><p>This STEM Training Starter kit is specially designed for students of lower grades with the aim that it should logically and fundamentally increase the knowledge of IoT, AI, and Electronics &amp; Technology, and at the same time, they can prepare themselves in advance for the smart world to come with <span style=\"color: rgb(0, 102, 204);\">smartivity </span>kits.</p><p>We have encapsulated more than 30 smart DIY electronic projects based on STEM Methodology in this single stem kit and atl kit, which your child can make very easily. All the projects are made with a simple plug-in-and-play form so that students can learn to make all the projects in the game without any soldering or use of electricity.</p>', NULL, '<p>This Electronic Experiment Kit consists of :</p><p>Training PCB, Solar Panel,</p><p>DC Motor, Connecting Wires, Plastic Fan,</p><p>Battery – 9V with Connector, Laser diode, Potentiometer,</p><p>Touch and Water Sensor,</p><p>Magnetic compass, Screw Driver</p><p>Dimensions: 31*20*8.5 cm</p><p>Weight: 1023 gm&nbsp;</p><p>Input Power: 9V, 1.2A</p>', NULL, '<p>N/A</p>', NULL, '<p>IOTtech Smart Products.</p>', '0', NULL, NULL, 'true', 'Admin', NULL, '2024-07-29 12:32:59', '2024-07-29 12:32:59', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6ImFudXJhZy5rdW1hci44ODA5OUBnbWFpbC5jb20iLCJpYXQiOjE3MTgxOTY5ODZ9.g-jgvVlShxeeKIU0h6jxC5WUTDZ7DfFwhIODWP7TVJI', 'false', 'true', 'true', 'false', 'false'),
