(10, 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJuYW1lIjoiUm9ib3RpYyBLaXQiLCJpYXQiOjE3MjIyNTc2MjR9.uNwwtaD738QGU8Pk2SYxPYwCa0-wFM0XbLYe50sX0-s', 'Robotic Kit', NULL, 'Arduino & Ultrasonic Sensor', NULL, '', 'IB0025', '', '', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJuYW1lIjoiRWR1Y2F0aW9uYWwgS2l0cyBmb3IgU2Nob29sIiwiaWF0IjoxNzIxOTY0Njg4fQ.1iFTWGvMhF-R5BxUMOYoxAkkdZFMpzqcFNZ0zUfCCfc', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJuYW1lIjoiS2l0cyBQYWNrYWdlIiwiaWF0IjoxNzIxOTc4NzU3fQ.kgI_t2Jq_M8BjihCayhv2vyXmSiOaXmQy6AADlsT1A4', '', '', '12000', '9000', 'Include', '18', 'Value', '3000', '7627', '522', 'Obstacle-Avoiding-Robot', 'avatar-1722257624938.png', NULL, 'https://www.flipkart.com/yantram-obstacle-avoiding-robot-educational-electronic-hobby-kit/p/itmef71c2415f3c3?pid=EHKGRNKUAJGGHCHR', 'https://www.amazon.in/dp/B0CHYXVQFL?ref=myi_title_dp', '', '<p>An Obstacle Avoiding Robot is an intelligent device that can detect obstacles in its path and avoid them by turning in a different direction. This design enables the robot to navigate in an unknown environment while avoiding collisions, which is a fundamental requirement for any autonomous mobile robot we can say that when it encounters an obstacle while moving forward, it stops and steps back. Then it looks at two sides, left and right, and begins to move in the best possible direction, which is either left if there is another obstacle on the right or right if there is another obstacle on the left. The obstacle-avoiding robot is extremely useful and serves as the foundation for many large projects such as automatic cars, manufacturing factory robots, and even spacecraft robots.</p><p>It consists of the following components:</p><p>Arduino UNO, Smart robot car chassis with 2 x toy car wheels and 1 x Universal wheel</p><p>Two DC motors, L298N motor driver, HC-SR04 Ultrasonic Sonar sensor</p><p>servo 9g, 7.4V 1300mah Duracell battery</p><p>Jumper wires (male-to-male, male-to-female),&nbsp;</p><p>Screws and nuts.</p>', NULL, '<p>Dimensions (L*B*H):200*168*170 mm</p><p>Weight:430g</p><p>Input Power: 7.4V, 1300mah</p>', NULL, '<p>N/A</p>', NULL, '<p>IOTtech Smart Products.</p>', '0', NULL, NULL, 'true', 'Admin', NULL, '2024-07-29 12:53:44', '2024-07-29 12:53:44', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6ImFudXJhZy5rdW1hci44ODA5OUBnbWFpbC5jb20iLCJpYXQiOjE3MTgxOTY5ODZ9.g-jgvVlShxeeKIU0h6jxC5WUTDZ7DfFwhIODWP7TVJI', 'false', 'true', 'true', 'true', 'true'),
(11, 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJuYW1lIjoiQXRtZWdhMzI4UFUtVEggfCBTTUQiLCJpYXQiOjE3MjIyNTc4NDZ9.mA0JYuc85zFr7AFlPXoI2l1ag5lHDW2mFeH5qCsYR2Y', 'Atmega328PU-TH | SMD', NULL, '8-Bit Microcontroller Atmel®', NULL, '8542', 'IB0028', '', '', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJuYW1lIjoiRWxlY3Ryb25pYyBDb21wb25lbnRzIiwiaWF0IjoxNzIxOTY0MzgwfQ.BHk52jPEwYhYw9aNCeaw92nsCuOetYcA-_v5oJqaB0A', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJuYW1lIjoiSUMgKEludGVncmF0ZWQgQ2lyY3VpdCApIiwiaWF0IjoxNzIxOTc4MDYxfQ.RT6ImjUjGKaVRobotukfNu3Mzu1zC1D2UyL4WWrn4oA', '', '', '550', '499', 'Include', '18', 'Value', '51', '423', '500', 'Atmega328PU-TH-SMD', 'avatar-1722257846064.png', NULL, '', '', '', '<p><span style=\"color: rgb(51, 51, 51);\">The ATMEGA328-PU is a low-power CMOS 8-bit microcontroller based on the AVR-enhanced RISC architecture. By executing powerful instructions in a single clock cycle, the ATMEGA328-PU achieves throughputs approaching 1MIPS per MHz allowing the system designer to optimize power consumption versus processing speed.</span></p><p><br></p><p><span style=\"color: rgb(102, 102, 102);\">High Performance, Low Power Design</span></p><p><span style=\"color: rgb(102, 102, 102);\">8-Bit Microcontroller Atmel® AVR® advanced RISC architecture</span></p><ul><li>131 Instructions most of which are executed in a single clock cycle</li><li>Up to 20 MIPS throughput at 20 MHz</li><li>32 x 8 working registers</li><li>2 cycle multiplier</li></ul><p><span style=\"color: rgb(102, 102, 102);\">Memory Includes</span></p><p><br></p><ul><li>32KB of programmable FLASH</li><li>1KB of EEPROM</li><li>2KB SRAM</li><li>10,000 Write and Erase Cycles for Flash and 100,000 for EEPROM</li><li>Data retention for 20 years at 85°C and 100 years at 25°C</li><li>Optional boot loader with lock bits</li><li>In System Programming (ISP) via boot loader</li><li>True Read-While-Write operation</li><li>Programming lock available for software security</li></ul><p><br></p>', NULL, '<p><span style=\"color: rgb(102, 102, 102);\">Operating voltage:1.8 - 5.5V</span></p><p><span style=\"color: rgb(102, 102, 102);\">Operating temperature range:40°C to 85°C</span></p><p><span style=\"color: rgb(102, 102, 102);\">Speed Grades:</span></p><ul><li>0-4 MHz at 1.8-5.5V</li><li><br></li><li>0-10 MHz at 2.7-5.5V</li><li><br></li><li>0-20 MHz at 4.5-5.5V</li><li><br></li></ul><p><span style=\"color: rgb(102, 102, 102);\">Low power consumption mode at 1.8V, 1 MHz and 25°C:</span></p><ul><li>Active Mode: 0.3 mA</li><li><br></li><li>Power-down Mode: 0.1 μA</li><li><br></li><li>Power-save Mode: 0.8 μA (Including 32 kHz RTC&nbsp;&nbsp;</li><li><br></li><li><br></li><li><span style=\"color: rgb(102, 102, 102);\">I/O and Package</span></li><li>23 programmable I/O lines</li><li class=\"ql-indent-1\"><br></li><li class=\"ql-indent-1\">28-pin PDIP package</li></ul><p><br></p>', NULL, '<p>N/A</p>', NULL, '<p><strong style=\"color: rgb(0, 114, 195);\">MICROCHIP</strong></p>', '0', NULL, NULL, 'true', 'Admin', NULL, '2024-07-29 12:57:26', '2024-07-29 12:57:26', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6ImFudXJhZy5rdW1hci44ODA5OUBnbWFpbC5jb20iLCJpYXQiOjE3MTgxOTY5ODZ9.g-jgvVlShxeeKIU0h6jxC5WUTDZ7DfFwhIODWP7TVJI', NULL, NULL, NULL, NULL, NULL),
